pragma solidity ^0.4.18;

contract TicTacToe {
    uint constant public gameCost = 0.1 ether; // 要開始遊戲必須花費0.1ether

    uint8 public boardSize = 3; // 遊戲板大小

    uint8 movesCounter; // 移動步數，平手時會用到

    bool gameActive; // 啟動遊戲

    address[3][3] board; // 遊戲板為一個3x3矩陣

    address public player1;
    address public player2;

    uint balanceToWithdrawPlayer1; // 玩家1可以取回他的獎勵
    uint balanceToWithdrawPlayer2; // 玩家2可以取回他的獎勵

    uint timeToReact = 3 minutes; // 設定玩家反應時間為3分鐘
    uint gameValidUntil; // 遊戲有效時間

    address activePlayer; // 當前玩家

    event PlayerJoined(address player);
    event NextPlayer(address player);
    event GameOverWithWin(address winner);
    event GameOverWithDraw();
    event PayoutSuccess(address receiver, uint amountInWei);

    function TicTacToe() public payable {
        player1 = msg.sender;
        require(msg.value == gameCost); // 要開始遊戲必須要支付0.1ether
        gameValidUntil = now + timeToReact;
    }

    function joinGame() public payable {

        assert(player2 == address(0)); // 確保只有一位玩家能加入遊戲

        require(msg.value == gameCost); // 要開始遊戲必須要支付0.1ether

        gameActive = true; // TicTacToe必須要是2人遊戲才能開始

        player2 = msg.sender;

        PlayerJoined(player2); // 玩家加入時觸發的事件

        if(block.number % 2 == 0) {
            activePlayer = player2;
        } else {
            activePlayer = player1;
        }

        gameValidUntil = now + timeToReact;

        NextPlayer(activePlayer);
    }

    // 取得整個遊戲板資訊
    function getBoard() public view returns(address[3][3]) {
        return board;
    }

    // 設定贏家函式
    function setWinner(address player) private {
        gameActive = false;

        // 觸發一個事件
        GameOverWithWin(player);

        /*transfer money to the winner
          如果使用transfer()的話，失敗會rollback整個交易
        */
        uint balanceToPayOut = this.balance;

        if(player.send(balanceToPayOut) != true) {
            if(player == player1) {
                balanceToWithdrawPlayer1 = balanceToPayOut;
            } else {
                balanceToWithdrawPlayer2 = balanceToPayOut;
            }
        } else {
            PayoutSuccess(player, balanceToPayOut);
        }
    }

    function withdrawWin() public {
      uint balanceToTransfer;
        if(msg.sender == player1) {
            require(balanceToWithdrawPlayer1 > 0); // 確認是玩家1獲勝
            balanceToTransfer = balanceToWithdrawPlayer1;
            balanceToWithdrawPlayer1 = 0;
            player1.transfer(balanceToTransfer);

            PayoutSuccess(player1, balanceToTransfer);
        } else {
            require(balanceToWithdrawPlayer2 > 0); // 確認是玩家2獲勝
            balanceToTransfer = balanceToWithdrawPlayer2;
            balanceToWithdrawPlayer2 = 0;
            player2.transfer(balanceToTransfer);

            PayoutSuccess(player2, balanceToTransfer);
        }
    }

    // 設定平手函式
    function setDraw() private {
        gameActive = false;
        GameOverWithDraw();

        uint balanceToPayOut = this.balance/2;

        if(player1.send(balanceToPayOut) == false) {
            balanceToWithdrawPlayer1 += balanceToPayOut;
        } else {
            PayoutSuccess(player1, balanceToPayOut);
        }
        if(player2.send(balanceToPayOut) == false) {
            balanceToWithdrawPlayer2 += balanceToPayOut;
        } else {
            PayoutSuccess(player2, balanceToPayOut);
        }

    }

    // 當有一個玩家中途退出時，另一位可以取回其0.1ether
    function emergecyCashout() public {
        require(gameValidUntil < now);
        require(gameActive);
        setDraw();
    }


    function setStone(uint8 x, uint8 y) public {

        require(board[x][y] == address(0)); // 確保遊戲板上每個格子只能下一次

        require(gameValidUntil > now); // 確保遊戲有效時間

        assert(gameActive);

        assert(x < boardSize); // 選擇x和y時不能超過遊戲板大小
        assert(y < boardSize); // 選擇x和y時不能超過遊戲板大小

        require(msg.sender == activePlayer); // 必須要是當前玩家才能下

        board[x][y] = msg.sender;
        movesCounter++;
        gameValidUntil = now + timeToReact;

        // 1. 判斷行有無連線
        for(uint8 i = 0; i < boardSize; i++) {
            if(board[i][y] != activePlayer) {
                break;
            }
            //win
            if(i == boardSize - 1) {
                //winner
                setWinner(activePlayer);
                return;
            }
        }

        // 2. 判斷列有無連線
        for(i = 0; i < boardSize; i++) {
            if(board[x][i] != activePlayer) {
                break;
            }
            //win
            if(i == boardSize - 1) {
                //winner
                setWinner(activePlayer);
                return;
            }
        }

        // 3. 判斷對角線有無連線
        if(x == y) {
            for(i = 0; i < boardSize; i++) {
                if(board[i][i] != activePlayer) {
                    break;
                }
                //win
                if(i == boardSize - 1) {
                    //winner
                    setWinner(activePlayer);
                    return;
                }
            }
        }

        // 4. 判斷反對角線有無連線
        if((x+y) == boardSize-1) {
            for(i = 0; i < boardSize; i++) {
                if(board[i][(boardSize-1)-i] != activePlayer) {
                    break;
                }
                //win
                if(i == boardSize - 1) {
                    //winner
                    setWinner(activePlayer);
                    return;
                }
            }
        }

        // 判斷平手的情況
        if(movesCounter == (boardSize**2)) {
            //draw
            setDraw();
            return;
        }

        // 當前玩家最後要換人
        if(activePlayer == player1) {
            activePlayer = player2;
        } else {
            activePlayer = player1;
        }

        NextPlayer(activePlayer); // 觸發下一位玩家的事件
    }
}
